import React from "react";
import { useNavigate } from "react-router-dom";
import "./LandingPage.css";

const LandingPage = () => {
  const navigate = useNavigate();

  const handleNavigation = (userType) => {
    if (userType === "student") {
      navigate("/login/student");
    } else if (userType === "professor") {
      navigate("/login/professor");
    }
  };

  return (
    <div className="landing-page">
      {/* Upper Section with Multiple Tile Lines */}
      <div className="tiles-section">
        {Array(5) // Generate 5 rows of tiles
          .fill(0)
          .map((_, rowIndex) => (
            <div key={rowIndex} className="tile-row">
              <div className="tile" style={{ backgroundColor: "#c9f7f5" }}></div>
              <div className="tile" style={{ backgroundColor: "#e2f1ff" }}></div>
              <div className="tile" style={{ backgroundColor: "#ffecb3" }}></div>
              <div className="tile" style={{ backgroundColor: "#fbc2eb" }}></div>
              <div className="tile" style={{ backgroundColor: "#bbdefb" }}></div>
            </div>
          ))}
      </div>

      {/* Lower Section */}
      <div className="lower-section">
        <h1 className="heading">I am</h1>
        <div className="button-group">
          <button
            className="user-button"
            onClick={() => handleNavigation("student")}
          >
            Student
          </button>
          <button
            className="user-button"
            onClick={() => handleNavigation("professor")}
          >
            Professor
          </button>
        </div>
        <p className="register-link">
          Don't have an account?{" "}
          <span
            onClick={() => navigate("/register")}
            className="register-link-text"
          >
            Register here!
          </span>
        </p>
      </div>
    </div>
  );
};

export default LandingPage;
